import { useEffect } from "react";

function Contacts(props) {
    useEffect(()=>{console.log(props.friends)},[])
  return (
    <div className="Contacts">
        <h2>Contacts</h2>
        {props.friends && props.friends.map((item)=>{return <div>{ item.first_name + " " + item.last_name }</div>})}
    </div>
  );
}

export default Contacts;

